import React, { Component } from 'react'
import '../css/List.css'

class List extends Component {
    state = {
        arr: ["第一个", "第二个", "第三个", "第四个", "第五个", "第六个", "第七个", "第八个", "第九个", "第十个"]
    }
    render() {
        return (
            <div>
                {
                    this.arr.map((item, index) => {
                        return (
                            <div className="list_main" key={index}>{item}</div>
                        )
                    })
                }
            </div>
        )
    }
}

export default List
